import React from 'react';
import styled from "styled-components";

const Container= styled.div`
          height:50px;
          background-color:green;
`
const Wrapper = styled.div`
        height:50px;
        background-color:green;
`


const Navbar = () => {
    return (
        <Container>
            <Wrapper>Navbar</Wrapper>
        </Container>
    )
}

export default Navbar;
